import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ApplicationUnitInfo from "../application/ApplicationUnitInfo";
import ApplicationBasicInfo from "../application/ApplicationBasicInfo";
import ApplicationRoommates from "../application/ApplicationRoomates";

const useStyles = makeStyles((theme) => ({
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

const UserPage = () => {

    const classes = useStyles();

    return (
        <form className={classes.root} noValidate autoComplete="off">
            <div>
                <ApplicationUnitInfo/>
                <ApplicationBasicInfo/>
                <ApplicationRoommates/>
            </div>
        </form>
    );
};
export default UserPage;
